class ContactLinks extends React.Component {
  constructor() {
    super();
  }

render() {
  return(
    <div className="links">
      <a href="mailto:Traci@Thompson.Codes" target="_href"><img src="../static/email.png" /></a>
      <a href="https://github.com/Traci7822" target="_href"><img src="../static/github.png" /></a>
      <a href="https://www.linkedin.com/in/tracihthompson" target="_href"><img src="../static/linkedin.png" /></a>

      <style jsx>{`
        .links {
          color: white;
          font-family: 'Cinzel', serif;
          width: 80%;
          font-size: 2em;
          margin-top: 5%;
        }
      `}</style>
    </div>
  )};
}
export default ContactLinks
